import { useState, useEffect } from "react";
import axios from "axios";

const baseUrl='http://127.0.0.1:8000/api';

function QuizResChild(props) {

    const [resultData, setResultData] = useState({});

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(`${baseUrl}/fetch-quiz-result/${props.quiz}/${props.user}`);
                setResultData(response.data);
            } catch (error) {
                console.log(error);
            }
        };
        fetchData();
    }, [props.quiz, props.user]);

    if (Object.keys(resultData).length === 0) {
        return null;
    }

    return (
        <div className="modal-dialog">
            <div className="modal-content">
                <div className="modal-header">
                    <h1 className="modal-title fs-5" id="exampleModalLabel">Modal title</h1>
                    <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                </div>
                <div className="modal-body">
                    <table className="table">
                        <thead>
                            <tr>
                                <th scope="col">Total Questions</th>
                                <td>{resultData.total_questions}</td>
                            </tr>
                            <tr>
                                <th scope="col">Attempted Questions</th>
                                <td>{resultData.total_attempted_questions}</td>
                            </tr>
                        </thead>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default QuizResChild;
